        a.sort()
    if any(b > n for b in b):
        b.sort()
    if any(c > n for c in c):
        c.sort()
    res = []
    a.sort()
    b.sort()
    c.sort()
    for i in range(n):
        if a[i] > n or b[i] > n or c[i] > n:
            continue
        res.append(a[i] - b[i] - c[i])
    res.sort()
    if n % 3 == 1:
        if n / 3 == 1:
            return str(sum(res))
        return str(res[n // 3])
    return str(res[n // 3]) + str(res[n % 3])



