class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        s_len = len(s)
        longest_substring = 0
        letter_count = {}
        for i in range(s_len):
            if s[i] not in letter_count:
                letter_count[s[i]] = 1
            else:
                letter_count[s[i]] += 1
                if letter_count[s[i]] > 1:
                    if letter_count[s[i]] - 1 in letter_count:
                        letter_count[s[i]] = letter_count[s[i]] - 1
                    else:
                        letter_count[s[i]] = 1
                elif letter_count[s[i]] == 1:
                    letter_count[s[i]] = 0
            if i >= longest_substring:
                longest_substring = i - 1
        return longest_substring

