            return min(a, b, c, d)
        def get_friend_num_using_two_pairs(a, b, c, d):
            return max(a, b) - min(a, b)

        def is_pair(a, b, c, d):
            if a*b < c*d:
                return False
            return True

        def is_pair_using_three_pairs(a, b, c, d):
            if a*b < c*d or c*d < a*b:
                return False
            if a*b < c*d or c*d < a*b:
                return True
            return False

        pair_list = list()
        pairs = list()
        for i in range(n):
            if is_pair(a, i+1, c, d):
                pairs.append((i+1, c, d))
            if is_pair(i+1, b, c, d):
                pairs.append((i+1, b, d))
        for pair in pairs:
            pair_list.append(''.join(map(str, pair)))
        pairs = sorted(pairs, key=lambda x: (x[1], x[2]))
        for pair in pairs:
            if is_pair_using_three_pairs(pair[0], pair[2], pair[1], pair[3]):
                continue
            pair_list.append(''.join(map(str, pair)))
