class Graph:
    def __init__(self, vertices):
        self.graph = defaultdict(list)
        self.vertices = vertices
        self.id = 0

    def addEdge(self,u,v,w):
        self.graph[u].append((v,w))

    def BFS(self,u):
        visited = [False] * self.vertices
        queue = [u]

        while queue:
            u = queue.pop(0)

            visited[u] = True

            for i in self.graph[u]:
                if not visited[i[0]]:
                    queue.append(i[0])
                    visited[i[0]] = True

        return visited

