def solution(stdin: str) -> str:
    parsed = list(map(str, stdin.split()))
    answer = ''
    index = 0
    if parsed[0] == 'A':
        index = 1
    if parsed[0] == 'B':
        index = 2
    if parsed[0] == 'C':
        index = 3
    while index < len(parsed):
        if parsed[index] == 'B':
            answer += 'A'
            index += 1
            if index + 1 < len(parsed):
                if parsed[index + 1] == 'A':
                    index += 1
        elif parsed[index] == 'C':
            answer += 'C'
            index += 1
            if index + 1 < len(parsed):
                if parsed[index + 1] == 'A':
                    index += 1
        else:
            answer += parsed[index]
        index += 1
    answer = answer[::-1]
    return answer
